paths:
  /WealthManagementWeb/ws/AccountDataInq/getAccountDetails:
    post:
      tags:
      - Account Data Inquiry Service
      x-group-name: Account Data Inquiry Service
      x-proxy-name: Account Details
      summary: ' getAccountDetails service'
      description: "This API fetches detail information about the account(s) associated with the account ID(s) passed to it. If no ID is passed, it returns information for all of the user's accounts."
      operationId: getAccountDetails
      requestBody:
        description: "<table> <thead> <th>Element/property</th> <th>Description</th>\
          \ </thead> <tbody> <tr> <td><b>Status</b></td> <td> The status of the request.</td>\
          \ </tr><tr> <td><b>RqUID</b></td> <td> Unique Request Identifier. The Client\
          \ Site sends this element with the request.</td> </tr><tr> <td><b>FILoginAcctList</b></td>\
          \ <td> List of FI Login Accounts for which the FILoginAcctInfo is to be\
          \ returned.</td> </tr><tr> <td><b>IncludeDetail</b></td> <td>The specified\
          \ detail information should be returned in the response.Possible values:\
          \ FIAcctSummary InvAcctPosAcctIdentifier</td> </tr><tr><td></td><td><a href='elementDescription.jsp#AccountDataInq_getAccountDetails'\
          \ target='_blank'>More Info</a></td></tr></tbody></table>"
        content:
          application/json:
            schema: 
              $ref: '#/components/schemas/FILoginAcctInfoListInqRqHeader'
            examples:
              getAccountDetails: {$ref: '#/components/examples/getAccountDetailsRequest'}
        required: true
      responses:
        "200":
          description: <a href="../docs?path=/docs/resources/api-guide/response/account-details.md">More Info</a>
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/FILoginAcctInfoListInqRsHeader'
              examples:
                getAccountDetails: {$ref: '#/components/examples/getAccountDetailsResponse'}
        "400":
          description: Bad Request
        "401":
          description: Unauthorized
        "403":
          description: Forbidden
        "500":
          description: " Internal Server Error,"
