  /WealthManagementWeb/ws/AccountDataInq/getDeletedTrans:
    post:
      tags:
      - Account Data Inquiry Service
      x-group-name: Account Data Inquiry Service
      x-proxy-name: Deleted Transactions
      summary: ' getDeletedTrans service'
      description: " This API is used to get the deleted transactions of all accounts\
        \ in the home or by account group with a specified date range and row index\
        \ of the batch.Client / Partner accumulating the transaction data in their\
        \ system should use this API to remove the deleted transactions to avoid duplication\
        \ of transactions in their system. The process is referred to as Transaction\
        \ deduping, which is done to keep the Transaction data in Alldata system to\
        \ be in sync with FI data. Any changes in the old transactions posted in FI\
        \ source will get updated in Alldata system through this process."
      operationId: getDeletedTrans
      requestBody:
        description: "<table><thead><th>Element / property</th><th>Description</th></thead><tbody><tr><td><b>RqUID</b></td><td>\
          \  Unique Request Identifier. The Client Site sends this element with the\
          \ request.</td></tr> <tr><td><b>SignonRq</b></td><td> User Authentication.</td></tr><tr><td><b>SelRangeDt</b></td><td>Date\
          \ range to fetch deleted transactions. </td></tr><tr><td><b>AcctGroup</b></td><td>To\
          \ mention specific Account group. If not mentioned includes all Account\
          \ group.Possible values are: Cash/Credit/Investment/OtherBill</td></tr><tr><td></td><td><a\
          \ href='elementDescription.jsp#AccountMgmt_addHostAccountsRq' target='_blank'>More\
          \ Info</a></td></tr></tbody></table>"
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/DeletedTrnInqRqHeader'
            examples:
              getDeletedTrans: {$ref: '#/components/examples/getDeletedTransRequest'}
        required: true
      responses:
