  /WealthManagementWeb/ws/AccountDataInq/getTransactions:
    post:
      tags:
      - Account Data Inquiry Service
      x-group-name: Account Data Inquiry Service
      x-proxy-name: Transactions
      summary: ' getTransactions service'
      description: "This API is used for searching for transactions in specified FI\
        \ Login accounts according to specified search criterion.TrnType can be used\
        \ to either retrieve debit transactions, credit transactions or both."
      operationId: getTransactions
      requestBody:
        description: "<table><thead><th>Element/property</th><th>Description</th></thead><tbody><tr><td><b>RqUID</b></td><td>\
          \ Unique Request Identifier. The Client Site sends this element with the\
          \ request.</td></tr><tr><td><b>FILoginAcctList</b></td><td> List of FI Login\
          \ Accounts from which the selected transactions are to be returned.</td></tr><tr><td><b>SearchCriterion</b></td><td>\
          \ The search criterion for which transactions are required.</td></tr><tr><td><b>TrnType</b></td><td>\
          \ Transaction type.Possible values: Debit ,Credit</td></tr><tr><td><b>SelRangeDt</b></td><td>\
          \ The date range for which transactions are to be returned.</td></tr><tr><td><b>SelRangeAmt</b></td><td>\
          \ The amount range for which transactions are to be returned.</td></tr><tr><td><b>StartAmt</b></td><td>\
          \ Start amount of amount range. Note: Presently, the Currency code is ignored\
          \ while performing the search, and results in all currencies are returned,\
          \ regardless of the currency code specified in the search.</td></tr><tr><td><b>EndAmt</b></td><td>End\
          \ amount of amount range.Note: Presently, the Currency code is ignored while\
          \ performing the search, and results in all currencies are returned, regardless\
          \ of the currency code specified in the search.</td></tr><tr><td></td><td><a\
          \ href='elementDescription.jsp#AccountDataInq_getTransactions' target='_blank'>More\
          \ Info</a></td></tr></tbody></table>"
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/FindTrnsInqRqHeader'
            examples: 
              getTransactions: {$ref: '#/components/examples/getTransactionsRequest'}
        required: true
      responses:
